import React from 'react';
import { Button, ButtonGroup } from '@material-ui/core';

const HeaderView = ({ setCurrentView }) => {
  return (
    <ButtonGroup variant="contained" color="primary" aria-label="contained primary button group">
      <Button onClick={() => setCurrentView('companies')}>Company Details</Button>
      <Button onClick={() => setCurrentView('campaigns')}>Campaigns</Button>
      <Button onClick={() => setCurrentView('payouts')}>Payouts</Button>
      <Button onClick={() => setCurrentView('invoices')}>Invoices</Button>
    </ButtonGroup>
  );
};

export default HeaderView;
